import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div style={{border: "1px solid", padding: "10px"}}>
      <h1 style={{fontSize: "25px"}}>Home</h1>
      <br />
      <Link to="/signup">SignUp</Link>
      <br />
      <hr />
      <Link to="/signin">SignIn</Link>
      <br />
      <hr />
      <Link to="/todo">Todo</Link>
    </div>
  );
}

export default Home;
